traceln("Starting behavior selection simulation");
v_rapidRun = true;
double time = System.currentTimeMillis();
double scenTime = time;
monteCarlo = true;
f_clearResultsCollections();

iterations = 500;
//v_EVsPerCP = 10;


// Define your checkboxes for iteration
ShapeCheckBox[] checkBoxes = {
    cb_b1,  // corresponds to b1
    cb_b2,  // corresponds to b2
    cb_b3,  // corresponds to b3
    cb_recheckCPAvailability // corresponds to b4
};

// Define only the desired combinations
// Order of booleans: {b1, b2, b3, b4}

boolean[][] subselection = {
    {false, false, false, false}, // No behaviors
    //{false, false, false, true},  // No behaviors, self checking
    {true,  false, false, false}, // Behavior 1
    {false, true,  false, false}, // Behavior 2
    {false, false, true, false}, // Behavior 3
    {true,  false, true,  false}, // Behavior 1 and 3
    {true,  true, false,  false}, // Behavior 1 and 2
    {false,  true, true,  false}, // Behavior 2 and 3
    {true,  true,  true,  false}  // All behaviors
};
/*
boolean[][] subselection = {
    {false, false, false, true}, // No behaviors
    //{false, false, false, true},  // No behaviors, self checking
    {true,  false, false, true}, // Behavior 1
    {false, true,  false, true}, // Behavior 2
    {false, false, true, true}, // Behavior 3
    {true,  false, true,  true}, // Behavior 1 and 3
    {true,  true, false,  true}, // Behavior 1 and 2
    {false,  true, true,  true}, // Behavior 2 and 3
    {true,  true,  true,  true}  // All behaviors
};*/

// Corresponding labels
String[] labels = {
    "No behaviors",
    //"No behaviors, self checking",
    "Behavior 1",
    "Behavior 2",
    "Behavior 3",
    "Behavior 1 and 3",
    "Behavior 1 and 2",
    "Behavior 2 and 3",
    "All behaviors"
};

// not 13, 15, 17, 18, 20


// Iterate only over these subselections
for( v_EVsPerCP = 1  ; v_EVsPerCP <= 3; v_EVsPerCP++ ){
	int newChargePoints = roundToInt(v_cars * v_shareEVs / v_EVsPerCP);
	if( newChargePoints != v_chargePoints ){


		for (int s = 0; s < subselection.length; s++) {
		    boolean[] scenario = subselection[s];
		    String label = labels[s];

		    // Apply the checkbox states
		    for (int i = 0; i < checkBoxes.length; i++) {
		        checkBoxes[i].setSelected(scenario[i], true);
		    }

		    // Log scenario info
		    System.out.println("Running scenario " + simulationCount + " : " + label);
		    //traceln("B1=" + scenario[0] + ", B2=" + scenario[1] + ", B3=" + scenario[2] + ", B4=" + scenario[3]);

		    // Run simulation
		    for (int i = 0; i < iterations; i++) {
		        f_initializeModel();
		        f_endRun();
		        mains.get(0).f_cleanUp();
		    }
		    f_storeMCResults();
		    simulationCount++;
		    f_writeBehaviorScenariosToExcel();
		    f_clearResultsCollections();
			Runtime.getRuntime().gc();
		}
		long usedMemory = (Runtime.getRuntime().totalMemory() - Runtime.getRuntime().freeMemory()) / (1024 * 1024);
		scenTime = (System.currentTimeMillis() - scenTime) / 1000.0;
		traceln("NCP = " + newChargePoints + " v_CP = " + v_chargePoints);
		traceln("Finished scenarios for " + v_EVsPerCP + " EVs per CP in " + roundToDecimal(scenTime / 60,2) + " minutes, with used memory: " + usedMemory + " MB");
		scenTime = System.currentTimeMillis();
	}
}


System.gc();
long usedMemory = (Runtime.getRuntime().totalMemory() - Runtime.getRuntime().freeMemory()) / (1024 * 1024);
double runTime = (System.currentTimeMillis() - time) / 1000.0;
traceln("Finished behavior scenarios " + simulationCount + " in " + runTime + " seconds, with used memory: " + usedMemory + " MB");
